في هذه الحياة؛
لن يستمر معك مال فلا تبالغ بفرحتك به ،وتعجب بنفسك عندما تملكه، ولا منصب فلا تأخذك نشوته واعتبر بمن سبقك، أو علاقات فلا تتكل عليهم فتتحسر غدا فهي لا تدوم ، وإنما فقط الأعمال النبيلة هي ما تدوم، كالمشاريع البناءة ، تفريج الكربات ، وتسهيل أمور الناس.
